    authDomain: "portfolio-alex-eb3ef.firebaseapp.com",
    databaseURL: "https://portfolio-alex-eb3ef.firebaseio.com",
    projectId: "portfolio-alex-eb3ef",
    storageBucket: "portfolio-alex-eb3ef.appspot.com",
    messagingSenderId: "776158175345",
    appId: "1:776158175345:web:2140b8f94fedf1103bbbd0",
    measurementId: "G-5VBPTVC7PQ"
  };
  // Initialize Firebase

  firebase.initializeApp(firebaseConfig)
  firebase.analytics()

  // console.log("key", firebaseConfig['apiKey'])

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
